  commentText: {
    color: "black",
    fontsize: 16,
  },
};

function Comment(props) {
  return (
    <div style={styles.wrapper}>
      <div style={styles.imageContaniner}>
        <div>
          <h1>first made Compoenent</h1>
        </div>
      </div>
    </div>
  );
}
export default Comment;
